        uint256[] memory amounts0 = _swapExactRewardsForTokens(
            splitRewardsBalance,
            data.tokenAPath
        );

        // swap reward tokens for token B
        uint256[] memory amounts1 = _swapExactRewardsForTokens(
            splitRewardsBalance,
            data.tokenBPath
        );
    }
